import React, { Component } from "react";

export class AddTodo extends Component {
  render() {
    return (
      <div>
        <form style={{display: 'flex'}}>
          <input type="text" style={{flex: '10', padding: '5px'}} placeholder="Add Todo..." />
          <input type="submit" style={{flex: '1'}} value="Submit" />
        </form>
      </div>
    );
  }
}

export default AddTodo;
